let db;
async function initDB(){return new Promise((resolve,reject)=>{const req=indexedDB.open('hjmops-db',1);req.onupgradeneeded=e=>{const d=e.target.result;if(!d.objectStoreNames.contains('orders'))d.createObjectStore('orders',{keyPath:'id',autoIncrement:true});if(!d.objectStoreNames.contains('inventory'))d.createObjectStore('inventory',{keyPath:'sku'});if(!d.objectStoreNames.contains('routes'))d.createObjectStore('routes',{keyPath:'id',autoIncrement:true});if(!d.objectStoreNames.contains('syncQueue'))d.createObjectStore('syncQueue',{keyPath:'id',autoIncrement:true});};req.onerror=e=>reject(e.target.error);req.onsuccess=e=>{db=e.target.result;resolve(db);};});}
function dbPut(store,rec){return new Promise((res,rej)=>{const tx=db.transaction(store,'readwrite');tx.oncomplete=()=>res();tx.onerror=e=>rej(e.target.error);tx.objectStore(store).put(rec);});}
function dbGetAll(store){return new Promise((res,rej)=>{const tx=db.transaction(store,'readonly');const req=tx.objectStore(store).getAll();req.onsuccess=()=>res(req.result);req.onerror=e=>rej(e.target.error);});}
function dbDelete(store,key){return new Promise((res,rej)=>{const tx=db.transaction(store,'readwrite');tx.objectStore(store).delete(key);tx.oncomplete=()=>res();tx.onerror=e=>rej(e.target.error);});}
// Fallback calculation functions
function calcOrderLocal(plan,code,qty,cost){let allowAmt=0;let costAmt=cost||0;if(plan.toLowerCase()!=='private'){let arr;switch(plan.toLowerCase()){case'medicaid':arr=medicaidAllowables;break;case'medicare':arr=medicareAllowables;break;case'commercial':arr=commercialAllowables;break;default:arr=null;}if(arr){for(const rec of arr){if(rec.procCode===code){allowAmt=rec.allowAmt;if(!costAmt)costAmt=rec.chargeAmt||0;break;}}}}else{allowAmt=costAmt;}const revenue=qty*allowAmt;const totalCost=qty*costAmt;const margin=revenue-totalCost;return{revenue:revenue,cost:totalCost,margin:margin};}
function calcRouteLocal(stops){function findCoord(city){city=city.toLowerCase();return driverMileage.find(r=>r.city.toLowerCase()===city);}function haversine(lat1,lng1,lat2,lng2){const R=6371;const toRad=deg=>deg*Math.PI/180;const dLat=toRad(lat2-lat1);const dLng=toRad(lng2-lng1);const a=Math.sin(dLat/2)**2+Math.cos(toRad(lat1))*Math.cos(toRad(lat2))*Math.sin(dLng/2)**2;const c=2*Math.atan2(Math.sqrt(a),Math.sqrt(1-a));return R*c*0.621371;}let total=0;for(let i=0;i<stops.length-1;i++){const a=findCoord(stops[i]);const b=findCoord(stops[i+1]);if(a&&b){total+=haversine(a.lat,a.lng,b.lat,b.lng);}}return{totalMiles:parseFloat(total.toFixed(2))};}
