/*
 * UI enhancements for responsive navigation and dark-mode support.
 *
 * We wait until the DOM content has loaded to attach event listeners to
 * the hamburger and theme toggle buttons.  The theme preference is
 * persisted in localStorage and falls back to the user's system
 * preference on first load.
 */
document.addEventListener('DOMContentLoaded', () => {
  const navToggle = document.getElementById('nav-toggle');
  const navLinks = document.querySelector('.nav-links');
  if (navToggle && navLinks) {
    navToggle.addEventListener('click', () => {
      navLinks.classList.toggle('active');
    });
  }
  const themeBtn = document.getElementById('themeToggle');
  function applyTheme(theme) {
    const root = document.documentElement;
    if (theme === 'dark') {
      root.style.setProperty('--background-color', '#1a1a1a');
      root.style.setProperty('--text-color', '#f5f5f5');
    } else {
      root.style.setProperty('--background-color', '#F9F9F9');
      root.style.setProperty('--text-color', '#333333');
    }
  }
  let storedTheme = localStorage.getItem('theme');
  if (!storedTheme) {
    storedTheme = window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light';
  }
  applyTheme(storedTheme);
  if (themeBtn) {
    themeBtn.addEventListener('click', () => {
      storedTheme = storedTheme === 'dark' ? 'light' : 'dark';
      localStorage.setItem('theme', storedTheme);
      applyTheme(storedTheme);
    });
  }
});

/*
 * Generic filter helper: attach this helper to an input and a table to
 * filter rows as the user types.  Provide CSS selectors for the input
 * element and the table.  For example:
 *   createFilter('#lookup-search', '#lookup-list table');
 */
function createFilter(inputSelector, tableSelector) {
  const input = document.querySelector(inputSelector);
  const table = document.querySelector(tableSelector);
  if (!input || !table) return;
  input.addEventListener('input', () => {
    const q = input.value.toLowerCase();
    table.querySelectorAll('tbody tr').forEach(row => {
      const text = row.textContent.toLowerCase();
      row.style.display = !q || text.includes(q) ? '' : 'none';
    });
  });
}

/*
 * Override the default service worker registration to use our static
 * service worker (sw.js).  Because functions with the same name
 * declared later in a script override earlier definitions, this
 * definition will take precedence over the dynamically generated
 * registerSW function defined above.
 */
function registerSW() {
  if ('serviceWorker' in navigator) {
    navigator.serviceWorker.register('sw.js').catch(() => {
      /* registration failed - offline functionality may be limited */
    });
  }
}
