// Route Assignment Enhancements: add 'Add to Route' button in orders list and automatic assignment on route page
(function(){
  function waitReady(cb){
    if(window.appReady){cb();} else {setTimeout(()=>waitReady(cb), 100);}
  }
  waitReady(()=>{
    if(!window.pendingRouteOrders){window.pendingRouteOrders=[];}
    window.assignOrderToRoute=function(id){
      id=parseInt(id,10);
      if(Number.isFinite(id)){
        if(!Array.isArray(window.pendingRouteOrders)){window.pendingRouteOrders=[];}
        if(!window.pendingRouteOrders.includes(id)){window.pendingRouteOrders.push(id);}
        window.location.hash='#routes';
      }
    };
    const origRefresh=window.refreshOrders;
    window.refreshOrders=async function(){
      const orders=await window.dbGetAll('orders');
      const cont=document.getElementById('orders-list');
      if(!orders.length){
        cont.innerHTML='<p>No orders yet.</p>';
        return;
      }
      let html='<table><thead><tr><th>ID</th><th>Plan</th><th>Type</th><th>Code</th><th>Qty</th><th>Start</th><th>Cycle</th><th>Revenue</th><th>Cost</th><th>Margin</th><th>Route</th><th>Date</th><th></th></tr></thead><tbody>';
      orders.forEach(o=>{
        const startStr=o.startDate?new Date(o.startDate).toLocaleDateString():'';
        const allowAssign=!o.assigned;
        const routeCell=allowAssign?'<button data-id="'+o.id+'" class="assign-route">Add to Route</button>':'Assigned';
        html+=`<tr><td>${o.id}</td><td>${o.plan}</td><td>${o.type||''}</td><td>${o.procCode}</td><td>${o.quantity}</td><td>${startStr}</td><td>${o.cycleMonths||''}</td><td>$${(o.revenue||0).toFixed(2)}</td><td>$${(o.cost||0).toFixed(2)}</td><td>$${(o.margin||0).toFixed(2)}</td><td>${routeCell}</td><td>${o.createdAt?new Date(o.createdAt).toLocaleString():''}</td><td><button data-id="${o.id}" class="delete-order">Delete</button></td></tr>`;
      });
      html+='</tbody></table>';
      cont.innerHTML=html;
      cont.querySelectorAll('.delete-order').forEach(btn=>{
        btn.addEventListener('click',async()=>{
          const id=parseInt(btn.getAttribute('data-id'),10);
          await dbDelete('orders',id);
          window.refreshOrders();
          updateDashboard();
        });
      });
      cont.querySelectorAll('.assign-route').forEach(btn=>{
        btn.addEventListener('click',ev=>{
          ev.preventDefault();
          const id=btn.getAttribute('data-id');
          window.assignOrderToRoute(id);
        });
      });
    };
    const origBuildRoutes=window.buildRoutes;
    window.buildRoutes=function(){
      origBuildRoutes();
      const sec=document.getElementById('routes');
      const form=sec?sec.querySelector('#route-form'):null;
      if(!form) return;
      const stopsInput=form.querySelector('input[name="stops"]');
      function assignPending(){
        const stops=(stopsInput.value||'').split(',').map(s=>s.trim()).filter(s=>s);
        if(!stops.length)return;
        const first=stops[0];
        const assigns=window.pendingRouteOrders||[];
        if(assigns.length){
          form.querySelectorAll('select[name="orderAssign"]').forEach(sel=>{
            const oid=parseInt(sel.getAttribute('data-id'),10);
            if(assigns.includes(oid)){
              sel.value=first;
            }
          });
        }
      }
      stopsInput.addEventListener('change',assignPending);
      setTimeout(assignPending,200);
      form.addEventListener('submit',()=>{
        window.pendingRouteOrders=[];
      });
    };
    // Immediately refresh orders list so the Route column appears without waiting for user interaction
    if (typeof window.refreshOrders === 'function') { refreshOrders = window.refreshOrders; window.refreshOrders(); }
  });
})();



// Orders Enhancer: adds Route column and assign buttons for orders table
(function(){
  function waitReady(cb){ if(window.appReady && window.dbGetAll){ cb(); } else { setTimeout(()=>waitReady(cb), 200); } }
  waitReady(()=>{
    async function ordersEnhancer(){
      const cont=document.getElementById('orders-list');
      if(!cont) return;
      const table=cont.querySelector('table');
      if(!table) return;
      const thead=table.tHead; const tbody=table.tBodies[0];
      if(!thead||!tbody) return;
      const headerRow=thead.rows[0];
      // Add Route header if not present
      if(!headerRow.querySelector('.route-header')){
        const th=document.createElement('th');
        th.className='route-header';
        th.textContent='Route';
        let inserted=false;
        for(let i=0;i<headerRow.children.length;i++){
          if(headerRow.children[i].textContent.trim()==='Date'){ headerRow.insertBefore(th, headerRow.children[i]); inserted=true; break; }
        }
        if(!inserted) headerRow.appendChild(th);
      }
      const orders=await window.dbGetAll('orders');
      const map={};
      orders.forEach(o=>{map[o.id]=o.assigned;});
      let dateIndex=-1;
      for(let i=0;i<headerRow.children.length;i++){
        if(headerRow.children[i].textContent.trim()==='Date'){ dateIndex=i; break; }
      }
      if(dateIndex<0) dateIndex=headerRow.children.length-1;
      Array.from(tbody.rows).forEach(row=>{
        const id=parseInt(row.cells[0].textContent.trim(),10);
        let cell=row.querySelector('.route-cell');
        if(!cell){
          cell=document.createElement('td');
          cell.className='route-cell';
          row.insertBefore(cell, row.children[dateIndex]);
        }
        const assigned=map[id];
        if(assigned){ cell.textContent='Assigned'; } else { cell.innerHTML='<button data-id="'+id+'" class="assign-route">Add to Route</button>'; }
      });
      tbody.querySelectorAll('.assign-route').forEach(btn=>{
        if(!btn._boundRoute){
          btn._boundRoute=true;
          btn.addEventListener('click',ev=>{
            ev.preventDefault();
            const id=btn.getAttribute('data-id');
            window.assignOrderToRoute(id);
          });
        }
      });
    }
    ordersEnhancer();
    setInterval(ordersEnhancer, 500);
  });
})();



(function(){
  function waitReady(cb){ if(window.appReady && window.calcOrderLocal){ cb(); } else { setTimeout(()=>waitReady(cb), 200); } }
  waitReady(()=>{
    function ensureDisplay(){
      const form=document.getElementById('order-form');
      if(!form) return null;
      let disp=document.getElementById('allowable-display');
      if(!disp){
        disp=document.createElement('p');
        disp.id='allowable-display';
        disp.style.fontWeight='bold';
        form.appendChild(disp);
      }
      return disp;
    }
    async function updateAllowable(){
      const form=document.getElementById('order-form');
      if(!form) return;
      const code=form.querySelector('input[name="procCode"]').value.trim();
      const plan=form.querySelector('select[name="plan"]').value;
      const type=form.querySelector('select[name="type"]').value;
      const disp=ensureDisplay();
      if(!code){ if(disp) disp.textContent=''; return; }
      try {
        // Use allowances from lookup when available
        const allowances=window.selectedLookupAllowances;
        if(allowances && window.selectedLookupCode && window.selectedLookupCode===code){
          let key=null;
          const plc=plan.toLowerCase();
          if(plc.includes('medicaid')) key='medicaid';
          else if(plc.includes('medicare')) key='medicare';
          else if(plc.includes('commercial')) key='commercial';
          if(key && allowances[key]){
            const total=(type==='rental'? parseFloat(allowances[key].rental||0) : parseFloat(allowances[key].purchase||0));
            if(disp) disp.textContent=plan+' '+type+' allowable: $'+(isFinite(total)?total.toFixed(2):'0.00');
            if(plc.includes('private')){
              const allowInp=form.querySelector('input[name="allowable"]');
              if(allowInp && isFinite(total)) allowInp.value=total.toFixed(2);
            }
            return;
          }
        }
        // Fallback using calcOrderLocal when no precomputed allowances exist
        const result= await window.calcOrderLocal(plan, code, 1, 0);
        const monthly = result && result.revenue ? result.revenue : 0;
        const lc=plan.toLowerCase();
        const cycle=(lc==='medicare'||lc==='commercial')?11:1;
        const total=(type==='rental')? monthly*cycle : monthly;
        if(disp) disp.textContent = plan+' '+type+' allowable: $'+total.toFixed(2)+(type==='rental'? ' (monthly $'+monthly.toFixed(2)+')':'');
        if(plan.toLowerCase().includes('private')){
          const allowInp=form.querySelector('input[name="allowable"]');
          if(allowInp) allowInp.value = total.toFixed(2);
        }
      }catch(err){ if(disp) disp.textContent=''; }
    }
    const form=document.getElementById('order-form');
    if(form){
      const planSel=form.querySelector('select[name="plan"]');
      const typeSel=form.querySelector('select[name="type"]');
      const codeInp=form.querySelector('input[name="procCode"]');
      if(planSel) planSel.addEventListener('change', updateAllowable);
      if(typeSel) typeSel.addEventListener('change', updateAllowable);
      if(codeInp) codeInp.addEventListener('input', updateAllowable);
    }
    if(window.selectedLookupCode){
      setTimeout(updateAllowable, 300);
    }
  });
})();



(function(){
  // Helper to parse currency or numeric strings into floats
  function parseAllowance(text){
    const num=parseFloat(String(text).replace(/[^0-9.]/g,''));
    return isNaN(num)?0:num;
  }
  // Bind allowance capture to Add-to-Order buttons in lookup
  function bindAllowButtons(){
    const btns=document.querySelectorAll('.lookup-add-order');
    btns.forEach(btn=>{
      if(btn._boundAllow) return;
      btn._boundAllow=true;
      btn.addEventListener('click', ev=>{
        const row=btn.closest('tr');
        if(row){
          const cells=row.children;
          if(cells && cells.length>=8){
            window.selectedLookupAllowances={
              medicaid:{purchase:parseAllowance(cells[2].textContent), rental:parseAllowance(cells[3].textContent)},
              medicare:{purchase:parseAllowance(cells[4].textContent), rental:parseAllowance(cells[5].textContent)},
              commercial:{purchase:parseAllowance(cells[6].textContent), rental:parseAllowance(cells[7].textContent)}
            };
          }else{
            window.selectedLookupAllowances=null;
          }
        }
        window.selectedLookupCode=btn.getAttribute('data-code');
        // After capturing allowances and setting selected code, schedule updateAllowable on orders page
        // After navigation to the Orders page, compute and display the allowable amount
        setTimeout(() => {
          const form=document.getElementById('order-form');
          if(!form) return;
          const planSel=form.querySelector('select[name="plan"]');
          const typeSel=form.querySelector('select[name="type"]');
          const updateDisplay=function(){
            const plan=planSel?planSel.value:'';
            const type=typeSel?typeSel.value:'';
            const allowances=window.selectedLookupAllowances;
            if(allowances){
              let key=null;
              const plc=(plan||'').toLowerCase();
              // determine key based on plan; for private pay pick a default
              if(plc.includes('medicaid')) key='medicaid';
              else if(plc.includes('medicare')) key='medicare';
              else if(plc.includes('commercial')) key='commercial';
              // if private pay or no key, choose a fallback based on available allowances
              if(!key || plc.includes('private')){
                if(allowances.medicaid) key='medicaid';
                else if(allowances.medicare) key='medicare';
                else if(allowances.commercial) key='commercial';
              }
              if(key && allowances[key]){
                const total=(type==='rental'? parseFloat(allowances[key].rental||0) : parseFloat(allowances[key].purchase||0));
                let disp=document.getElementById('allowable-display');
                if(!disp){
                  disp=document.createElement('p');
                  disp.id='allowable-display';
                  disp.style.fontWeight='bold';
                  form.appendChild(disp);
                }
                if(disp){
                  // Use plan name in label; for private pay display as 'Private Pay'
                  const displayPlan = plc.includes('private') ? 'Private Pay' : plan;
                  disp.textContent = displayPlan+' '+type+' allowable: $'+(isFinite(total)?total.toFixed(2):'0.00');
                }
                // Autofill allowable input; set value for private pay or clear for others
                {
                  const allowInp=form.querySelector('input[name="allowable"]');
                  if(allowInp){
                    if(plc.includes('private')){
                      if(isFinite(total)) allowInp.value=total.toFixed(2);
                    } else {
                      // Clear any previous custom allowable when not private pay
                      allowInp.value='';
                    }
                  }
                }
              }
            }
          };
          // Perform initial display update
          updateDisplay();
          // Attach listeners to update display when plan or type changes (once)
          if(!form._allowUpdateAttached){
            form._allowUpdateAttached=true;
            if(planSel) planSel.addEventListener('change', updateDisplay);
            if(typeSel) typeSel.addEventListener('change', updateDisplay);
          }
        }, 500);
      });
    });
  }
  // Periodically attach handlers as lookup rows are dynamically inserted
  setInterval(bindAllowButtons, 1000);
})();
